import React from 'react';
import ListMeal from './ListMeal/index'; // Asegúrate de que la ruta sea correcta
import { FilterProvider } from './Context/filtersCtx';
import SearchBox from '../components/SearchBox/index'

function Home() {
	return (
		<div className='page'>
			<FilterProvider>
				<SearchBox />
				<ListMeal />
			</FilterProvider>
		</div>
	);
}

export default Home;
